import { useEffect,useState} from "react";
import axios from 'axios';
function Creators(){
    const [pro,setpro] =useState([])

        axios.get('http://localhost:5001/profilepic')
            .then( res =>{
                console.log(res);
                setpro(res.data);
            })
            .catch( err =>{
                console.log(err);
            })

    return (
        <>
            {pro.map(e => <div>{e.username}</div>)}
        </>
    )
}
export default Creators
